// src/components/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';
import image from './assets/location.jpg';
 // Import the CSS for styling

const HomePage = () => {
    return (
        <div className="homepage-container">
            {/* Left Section: Image */}
            <div className="image-section">
                <img src="/assets/location.jpg" alt="Map location" />
            </div>

            {/* Right Section: Text */}
            <div className="text-section">
                <h1>Welcome to TOLET Globe</h1>
                <p>Your one-stop solution for finding rental properties.</p>

                {/* Add a button to navigate to the contact page */}
                <Link to="/contact">
                    <button className="contact-button">Contact Us</button>
                </Link>
            </div>
        </div>
    );
};

export default HomePage;
